import React, { useState, useEffect } from "react";
imp
import Table from "../node_modules/@material-ui/core/Table";
import TableBody from "../../../CarProjects/frontend/node_modules/@material-ui/core/TableBody";
import TableCell from "../../../CarProjects/frontend/node_modules/@material-ui/core/TableCell";
import TableContainer from "../../../CarProjects/frontend/node_modules/@material-ui/core/TableContainer";
import TableHead from "../../../CarProjects/frontend/node_modules/@material-ui/core/TableHead";
import TableRow from "../../../CarProjects/frontend/node_modules/@material-ui/core/TableRow";
import Paper from "../../../CarProjects/frontend/node_modules/@material-ui/core/Paper";
import { makeStyles } from '../../../CarProjects/frontend/node_modules/@material-ui/core/styles';
import { colors, Grid } from "../../../CarProjects/frontend/node_modules/@material-ui/core";
import NewCar,{handelChangeName} from "./NewCar"

const useStyles = makeStyles((theme) => ({
  root: {
    padding: theme.spacing(4),
  },
}));


const CarTable = (props) => {

  const classes = useStyles();

const url = "http://localhost:3001/api"

  const [data, setData] = useState([]);

  const fetchData = async ()=>{
    const res = await fetch(
      `${url}/data`,
      {
        method: "GET",
        headers: {
          'Content-Type': 'application/json',
        }
      }
    );
    if(res.status===200){
      const newData = await res.json()
      setData(newData);
    }
  }

  useEffect(()=>{
    fetchData();
  },[])

  return (
    <Grid container spacing={10}  direction="column">
      <Grid item xs={12} lg={8}>
      <TableContainer component={Paper}>
    <Table className={classes.table} aria-label="simple table">
      <TableHead>
        <TableRow>
          <TableCell align="left">Car name</TableCell>
          <TableCell align="left">Top speed</TableCell>
          <TableCell align="left">Price</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {
        data.map((car) => (
              <TableRow key={car._id}>
                <TableCell component="th" scope="row">
                  {car.name}
                </TableCell>
                <TableCell align="left">{car.topSpeed}</TableCell>
                <TableCell align="left">{car.price}</TableCell>
              </TableRow>
            ))}
      </TableBody>
    </Table>
  </TableContainer> 
      </Grid>
      <Grid item xs={12}>
      <NewCar url = {url} setData = {setData} data = {data}/>
      </Grid>
    </Grid>
  );
};

export default CarTable;
